@agent1su

You are probably the dumbest person, that actually knows how to use a computer. You say that he can't even write proper English... Let's take a look at what you typed. You used almost no caps, and the only punctuation you used consisted of a few periods here and there. You said that he can't even "write" proper English. News flash, this is a computer, we TYPE on computers. Also you used Fuck, and Ass like they are going out of style, which was very unnecessary. As for the racist remarks. Don't be mad because you aren't white. Just because white people are smarter, and less likely to have AIDS then black people doesn't mean you have to be an internet troll. I am assuming you are black because of the grammar issues, and the lack of sophisticated words. I would say it is a safe assumption.
